display:flex;
flex-direction:row;
margin-bottom: 20px;
`;

const Check = styled.button`
border-radius: 50px;
border: 3px solid blue;
width: 20px;
height: 20px;
margin-right: 10px;

`;

const DeleteImage = styled.img`
width: 20px;
heigth: 30px;
padding-left:265px;
`;

const Text = styled.div`
font-size: 24px;
margin-top:-5px;
`;
const [todo, setTodo] = useState({
    id: null,
    text: "",
    isDone: false
})
function TodoItems() {
    return (
        <Container>
            <Check></Check>
            <Text>hello</Text>
            <DeleteImage type="checkbox" src={DeleteImg} onClick={deleteItem}></DeleteImage>
        </Container>
    )
}
const deleteItem =(e) => {
    const {value} = e.target;
    setTodo({
        id: '',
        text: '',
        isDone: false
    })
}
export default TodoItems;
